import { useNavigate } from 'react-router-dom';
import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar';
import '../styles/FindDoctor.css';
import { fetchDoctors } from '../services/api'; // API logic

const FindDoctor = () => {
  const [doctors, setDoctors] = useState([]);
  const [page, setPage] = useState(1);
  const [loading, setLoading] = useState(false);
  const [filters, setFilters] = useState({
    city: '',
    expertise: '',
    experience: '',
    name: '',
  });

  const loadDoctors = async (reset = false) => {
    setLoading(true);
    try {
      const response = await fetchDoctors(page, filters);
      setDoctors((prev) =>
        reset
          ? response
          : [
              ...prev.filter(
                (prevDoc) => !response.some((newDoc) => newDoc.id === prevDoc.id)
              ),
              ...response,
            ]
      );
      setPage((prev) => prev + 1);
    } catch (error) {
      console.error('Error fetching doctors:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters((prev) => ({ ...prev, [name]: value }));
  };

  const handleApplyFilters = () => {
    setPage(1);
    loadDoctors(true); // Reset the doctor list and refetch with filters
  };

  // Fetch doctors on initial render
  useEffect(() => {
    loadDoctors();
  }, []);

  return (
    <div className="find-doctor">
      <Navbar />
      <div className="filters-container">
        <h2>Filter Doctors</h2>
        <div className="filters">
          <input
            type="text"
            placeholder="City"
            name="city"
            value={filters.city}
            onChange={handleFilterChange}
            className="filter-input"
          />
          <input
            type="text"
            placeholder="Expertise"
            name="expertise"
            value={filters.expertise}
            onChange={handleFilterChange}
            className="filter-input"
          />
          <input
            type="number"
            placeholder="Years of Experience"
            name="experience"
            value={filters.experience}
            onChange={handleFilterChange}
            className="filter-input"
          />
          <input
            type="text"
            placeholder="Name"
            name="name"
            value={filters.name}
            onChange={handleFilterChange}
            className="filter-input"
          />
          <button className="apply-filters-btn" onClick={handleApplyFilters}>
            Apply Filters
          </button>
        </div>
      </div>
      <div className="welcome-container">
        <h1>Welcome to Find a Doctor</h1>
        <p>Discover the best doctors near you and their expertise.</p>
      </div>
      <div className="cards-container">
        {doctors.map((doctor, index) => (
          <div key={index} className="doctor-card">
            <div className="profile-pic">
              {doctor.profile_pic ? (
                <img src={doctor.profile_pic} alt={doctor.name} />
              ) : (
                <div className="placeholder-pic">No Image</div>
              )}
            </div>
            <div className="doctor-info">
              <h3>{doctor.name}</h3>
              <p>City: {doctor.city}</p>
              <p>Degree: {doctor.degree}</p>
              <p>Experience: {doctor.experience} years</p>
              <p>Expertise: {doctor.top_expertise}</p>
              {doctor.services.length > 0 && (
                <p>Services: {doctor.services.join(', ')}</p>
              )}
            </div>
          </div>
        ))}
        {loading && <div className="loading">Loading...</div>}
      </div>
    </div>
  );
};

export default FindDoctor;
